import React, { useState } from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Subscription() {
  const [selectedPlan, setSelectedPlan] = useState(null);

  return (
    <div>
      {/* ... rest of the component code */}
      <table
        style={{
          backgroundColor: "#1200b8",
          color: "#ffffff",
          marginTop: "20px",
          marginLeft: "auto",
          marginRight: "auto",
        }}
      >
        <tbody>
          <tr>
            <td></td>
            <td>
              <button
                style={{
                  backgroundColor:
                    selectedPlan === "Standard" ? "#fc2003" : "transparent",
                  color: "#ffffff",
                  border: "none",
                }}
                onClick={() => setSelectedPlan("Standard")}
              >
                Standard
              </button>
            </td>
            <td>
              <button
                style={{
                  backgroundColor:
                    selectedPlan === "Premium" ? "#fc2003" : "transparent",
                  color: "#ffffff",
                  border: "none",
                }}
                onClick={() => setSelectedPlan("Premium")}
              >
                Premium
              </button>
            </td>
          </tr>
          {/* ... rest of the table code */}
        </tbody>
      </table>
      {/* ... rest of the component code */}
    </div>
  );
}
